import './Tab1.css'
import Autocomplete from '@mui/material/Autocomplete';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';

export default function Tab1() {
  const main = ['Ranking 1','Ranking 2'];
  const add = ['Ranking 1', 'Ranking 2'];
  const states = ['State 1', 'State 2'];

    return (
      <>
        <h1>Welcome to Tab 1.</h1> 
        <div className='box'>
          <div>
            <Autocomplete
              disablePortal
              id="combo-box-demo"
              className='tab'
              options={main}
              sx={{ width: 600 }}
              renderInput={(params) => <TextField {...params} label="Choose Main Ranking" />}
            />
            <Autocomplete
              disablePortal
              id="combo-box-demo"
              className = 'tab'
              options={add}
              sx={{ width: 600 }}
              renderInput={(params) => <TextField {...params} label="Choose Additional Ranking (Optional)" />}
            />
          </div>
          <div className ='filter'>
            <p className = 'filter-header'>Filter Options</p>
            <div>
              <div className='filter-header'>Setting</div>
              <FormControlLabel control={<Checkbox />} label="Urban" />
              <FormControlLabel control={<Checkbox />} label="Suburban" />
              <FormControlLabel control={<Checkbox />} label="Rural" />
            </div>
            <div>
              <div className='filter-header'>Private/Public</div>
              <FormControlLabel control={<Checkbox />} label="Private" />
              <FormControlLabel control={<Checkbox />} label="Public" />
            </div>
            <div>
              <div className ='filter-header'>Location</div>
              <></>
              <Autocomplete
              disablePortal
              id="combo-box-demo"
              options={states}
              sx={{ width: 300 }}
              renderInput={(params) => <TextField {...params} label="States" />}
              />
            </div>
          </div>
        </div>
      </>
    );
}
